PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "files_departmentlist" ("id" char(32) NOT NULL PRIMARY KEY, "name" varchar(255) NOT NULL UNIQUE, "file_count" integer unsigned NOT NULL CHECK ("file_count" >= 0), "download_total" integer unsigned NOT NULL CHECK ("download_total" >= 0), "history_total" integer unsigned NOT NULL CHECK ("history_total" >= 0), "unapproved_files" integer unsigned NOT NULL CHECK ("unapproved_files" >= 0), "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "files_history" ("id" char(32) NOT NULL PRIMARY KEY, "user_history_id" char(32) NOT NULL, "action" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "files_notification" ("id" char(32) NOT NULL PRIMARY KEY, "user_id" char(32) NOT NULL, "message" varchar(255) NOT NULL, "notification_date" datetime NOT NULL, "is_read" bool NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "files_request" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_request_id" char(32) NOT NULL, "requested_file_id" char(32) NOT NULL, "description" varchar(255) NOT NULL, "status" varchar(50) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "files_customuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "role" varchar(50) NOT NULL, "department" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "files_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "files_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "files_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "files_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "files_download" ("id" char(32) NOT NULL PRIMARY KEY, "user_id" char(32) NOT NULL, "download_date" datetime NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "file_id_id" char(32) NOT NULL REFERENCES "files_filesystem" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Authentication_guest" ("id" char(32) NOT NULL PRIMARY KEY, "username" varchar(255) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "request_id" char(32) NOT NULL, "history_id" char(32) NOT NULL, "is_verified" bool NOT NULL, "email_verification_token" varchar(100) NULL UNIQUE, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "is_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "Authentication_librarian" ("id" char(32) NOT NULL PRIMARY KEY, "first_name" varchar(255) NOT NULL, "middle_name" varchar(255) NULL, "last_name" varchar(255) NOT NULL, "profile_image" varchar(100) NULL, "email" varchar(254) NULL UNIQUE, "institutional_email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "is_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "Authentication_student" ("id" char(32) NOT NULL PRIMARY KEY, "first_name" varchar(255) NOT NULL, "middle_name" varchar(255) NULL, "last_name" varchar(255) NOT NULL, "department" varchar(255) NOT NULL, "year" integer NOT NULL, "profile_image" varchar(100) NULL, "email" varchar(254) NULL UNIQUE, "institutional_email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "ask_for_forget_password" bool NOT NULL, "history_id" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "is_active" bool NOT NULL, "department_id_id" char(32) NULL REFERENCES "files_departmentlist" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Authentication_departmenthead" ("id" char(32) NOT NULL PRIMARY KEY, "first_name" varchar(255) NOT NULL, "middle_name" varchar(255) NULL, "last_name" varchar(255) NOT NULL, "department" varchar(255) NOT NULL UNIQUE, "profile_image" varchar(100) NULL, "email" varchar(254) NULL UNIQUE, "institutional_email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "is_active" bool NOT NULL, "department_id_id" char(32) NULL REFERENCES "files_departmentlist" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Authentication_teacher" ("id" char(32) NOT NULL PRIMARY KEY, "first_name" varchar(255) NOT NULL, "middle_name" varchar(255) NULL, "last_name" varchar(255) NOT NULL, "department" varchar(255) NOT NULL, "profile_image" varchar(100) NULL, "email" varchar(254) NULL UNIQUE, "institutional_email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "is_active" bool NOT NULL, "department_id_id" char(32) NULL REFERENCES "files_departmentlist" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "files_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "files_filesystem" ("id" char(32) NOT NULL PRIMARY KEY, "title" varchar(255) NOT NULL, "author" varchar(255) NULL, "availability" bool NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "approved" varchar(10) NOT NULL, "original_file_path" varchar(1024) NULL, "uploaded_by_id" char(32) NULL, "department_id" char(32) NULL REFERENCES "files_departmentlist" ("id") DEFERRABLE INITIALLY DEFERRED, "uploaded_by_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "file_extension" varchar(10) NULL, "file_size" integer unsigned NOT NULL CHECK ("file_size" >= 0), "description" varchar(255) NULL, "disapproval_reason" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "files_permissionsetting" ("id" char(32) NOT NULL PRIMARY KEY, "role" varchar(50) NOT NULL, "allowed" bool NOT NULL, "created_at" datetime NOT NULL, "updated_time" datetime NOT NULL, "actions" varchar(20) NOT NULL, "allowed_filter_fields" text NULL);
CREATE TABLE IF NOT EXISTS "files_searchquery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "query" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "ip_address" char(39) NULL);
CREATE TABLE IF NOT EXISTS "files_popularsearch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "query" varchar(255) NOT NULL UNIQUE, "last_searched" datetime NOT NULL, "count" integer NOT NULL);
